#include <stdio.h>

// Definisikan konstanta
#define Kp 0.5
#define Ki 0.2
#define Kd 0.1

// Definisikan variabel
float error;
float error_last;
float error_diff;
float error_sum;
float output;

// Definisikan fungsi
void pid_controller(float setpoint, float process_value)
{
    // Hitung error
    error = setpoint - process_value;

    // Hitung integral error
    error_sum += error;

    // Hitung differential error
    error_diff = error - error_last;

    // Hitung output
    output = Kp * error + Ki * error_sum + Kd * error_diff;

    // Simpan error untuk iterasi selanjutnya
    error_last = error;
}

int main()
{
    // Contoh penggunaan
    pid_controller(10, 5);
    printf("Output: %f
", output);

    return 0;
}"

